// component from material-ui
import Paper from '@material-ui/core/Paper'
import makeStyles from '@material-ui/core/styles/makeStyles'



const useStyles = makeStyles(theme => ({
  root: {
    background: 'url(https://images.unsplash.com/photo-1612151855475-877969f4a6cc?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1489&q=80)',
    objectFit: 'scale-down',
    // height: window.innerHeight,
  }
}))


function resize(e) {
  console.log(window.innerWidth)
  console.log(e.target.innerHeight)
}

function Home() {

  const windowHeightWidth = React.useState({})

  React.useEffect(()=>{
    window.addEventListener('resize', resize)
    resize()
    return () => window.removeEventListener('resize', resize)
  }, [])

  const classes = useStyles()


  return (
    <Paper className={classes.root}>
      this is a pper



    </Paper>
  )
}

export default Home
